import React from "react";
import { Link } from "react-router-dom";
import "./Footer.scss";
const Footer = () => {
  return (
    <>
      <footer className="footer py-5">
        <div className="footer-content">
          <div className="footer-links">
            <Link>PRIVACY POLICY</Link>
          </div>
        </div>
      </footer>
    </>
  );
};

export default Footer;
